import React from "react";

const Teacher = () => {
  const [products, setProducts] = useState([]);
  const [cart, setCart] = useState([]);

  useEffect(() => {
    fetch("./products.JSON")
      .then((res) => res.json())
      .then((data) => setProducts(data));
  }, []);
  return (
    <div>
      <div className="teacher-container">
        <h3>Teacher:</h3>
      </div>
    </div>
  );
};

export default Teacher;
